import React from "react";

function App() {
    return (

        <div>
            
            <p>L’APC regroupe les entreprises produisant à la fois du clinker et du ciment : Asment Témara, Ciments de l’Atlas, Ciments du Maroc et LafargeHolcim Maroc. Créée en 1982, l’APC a pour principales missions de représenter le secteur cimentier auprès des pouvoirs publics, des institutionnels et des groupements professionnels.</p>
            <ul>
                <li>Casablanca</li>
                <li>Rabat</li>
                <li>Hociama</li>
            </ul>
        </div>
    );
}
export default App;
